  const [state, setState] = useState(initialState);
  console.log(containers);
  // console.log(containers);
  // useEffect(() => {
  //   async function wait() {
  //     const allcontainers = await containers;
  //     setState({...state, allcontainers});
  //   }
  //   wait();
  // }, []);

  return (
    <div>
      {state.containers.map((container) => (
        <ContainerCard container={container} />
      ))}
    </div>
  );
}
